import React, { useState, useEffect } from 'react'

/**
 * Dashboard Page 
 * @param {Function} param0 Get Logged In Token
 * @returns {React.Component}
 */
function Dashboard({ getToken }) {
    const [ backendData, setBackendData ] = useState([{}])
    const token = getToken()

    useEffect(() => {
        // Get Orders Data 
        fetch('/api/orders', { method: 'POST', headers: { 'Content-Type': 'application/json' }, body: JSON.stringify({key: token}) })
        .then( response => response.json())
        .then( data => { 
            console.log(data)
            if(data.success === true) {
                console.log('Success')
                setBackendData({ orders: data.data }) 
            } else {
                console.log('Error')
            }
        });
    }, [])

    return (
        <div className="card text-bg-dark m-2 border-none">
            <div className="card-header text-center">
                <h1>Dashboard</h1>
            </div>
            <div className="card-body text-center">
                
            </div>
        </div>
    )
}

export default Dashboard
